import 'dart:convert';
import 'package:fml/helper/url.dart';
import 'package:fml/hive/app.dart';
import 'package:fml/system.dart';
import 'package:flutter/material.dart';

class Splash extends StatefulWidget
{
  final VoidCallback? onInitializationComplete;

  const Splash({Key? key, this.onInitializationComplete}) : super(key: key);

  @override
  _SplashState createState() => _SplashState();
}


class _SplashState extends State<Splash>
{
  @override
  void initState()
  {
    super.initState();
    initialize();
  }

  Future<void> initialize() async
  {
    // initialize the system
    await System().initialized;

    // set default app
    if (isWeb)
    {
      // parse base url
      Uri? uri = Url.parse(Uri.base.toString());

      // if localhost - use the default domain and route
      // port 9000 is used by node.js by our installer
      if (uri != null)
      {
        bool localhost = uri.host.startsWith(RegExp("localhost", caseSensitive: false));
        if (localhost && uri.port != 9000) uri = Url.parse(defaultDomain);
      }

      // create an app
      var app = App(url: uri!.domain!, title: "web");
      await app.initialized;
      System().app = app;
    }

    // get domain
    String? domain = System().domain;

    // set domain
    await System().setDomain(domain);

    // return
    if (widget.onInitializationComplete != null) widget.onInitializationComplete!();
  }

  @override
  Widget build(BuildContext context)
  {
    return LayoutBuilder(builder: _build);
  }

  Widget _build(BuildContext context, BoxConstraints constraints)
  {
    return MaterialApp(debugShowCheckedModeBanner: false, title: '', home: _buildBody(constraints));
  }

  Widget _buildBody(BoxConstraints constraints)
  {
    var logo = Image.memory(Base64Codec().decode(""), width: 200, height: 200);
    //if (Image.asset("images/splash.gif");// )

    return Container(color: Colors.white, child: Center(child: logo));
  }
}